import type { Meta } from "@storybook/react";

const meta: Meta<typeof IconFavorite> = {
  title: "Atoms/Icon",
  component: IconFavorite,
  tags: ["autodocs"],
};

export default meta;
type Story = StoryObj<typeof IconFavorite>;

export const EmptyHeart: Story = {
  args: {
    isFilled: false,
  },
};


export const FullHeart: Story = {
  args: {
    isFilled: true,
